import styles from './launchPanel.module.css';

export default function LaunchPanel({ launchData }) {
    return (
        <div className={styles.container}>
            {launchData.map(function(singleData) {
                return (
                    <div 
                        key={singleData.flight_number}
                        className={styles.card} >

                        <div className={styles.heroImage}>
                            <img 
                                src={singleData.links.mission_patch} 
                                width='50%' 
                                alt={singleData.mission_name} />
                        </div>

                        <div className={styles.heroHeader}> {singleData.mission_name} #{singleData.flight_number} </div>
                        <hr />

                        <div className={styles.cardText}> <b>Mission Ids:</b> {singleData.mission_id.length > 0 ? singleData.mission_id : 'No Records found'} </div>

                        <hr />
                        <div className={styles.cardText}>
                            <table style={{width: '50px'}}>
                                <tr>
                                    <td><b>Launch Year:</b></td>
                                    <td>{singleData.launch_year || 'No Records found'}</td>
                                </tr>
                                <tr>
                                    <td><b>Successful Launch:</b></td>
                                    <td> { singleData.launch_success !== null ? singleData.launch_success.toString() : 'Unknown'}</td>
                                </tr>
                                <tr>
                                    <td><b>Successful Landing:</b></td>
                                    <td> { singleData.launch_success !== null ? singleData.launch_success.toString() : 'Unknown'}</td>
                                </tr>
                            </table>
                            {/* <div className={styles.cardText}> <b>Launch Year:</b> {singleData.launch_year || 'No Records found'} </div>
                            <div className={styles.cardText}> <b>Successful Launch:</b> { singleData.launch_success !== null ? singleData.launch_success.toString() : 'Unknown'} </div>
                            <div className={styles.cardText}> <b>Successful Landing:</b> { singleData.launch_success !== null ? singleData.launch_success.toString() : 'Unknown' } </div> */}
                        </div>
                    </div>
                );
            })}
        </div>
    );
}
